import React from "react";

const App = () => {
  const age = 29;
  const nbreRandom = Math.ceil(Math.random() * 100);
  if (nbreRandom > age) {
    console.log(nbreRandom);

    alert("Hello guy");
  }

  return <div>Hello</div>;
};

export default App;
